function Rating() {

    const [text,settext]=useState('this is a text')
    const [rating,setrating]=useState(7)
    const Click =()=>{
        setrating((prev)=>{
            return prev
        })
    }

  return (
    <div className='card'>
    
    <div className='num-display'>{rating}</div>
    <div className='text-display'>{text}</div>
    <button onClick={Click}>add</button>
    </div>

   
  )
}

export default Rating
